import React from "react";
import {
  Row, Col, Container, Card
} from 'react-bootstrap';

function Example() {
const [show, setShow] = useState(false);

const handleClose = () => setShow(false);
const handleShow = () => setShow(true);


const Info = props => {
  return(

  <Card style={{ width: '18rem' }}>
    <Card.Body>
      <Card.Title>Closet Information</Card.Title>
      <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
      <Row><Card.Text> Email: {props.email} </Card.Text></Row>
      <Row><Card.Text> City: {props.city} </Card.Text></Row>
      <Row><Card.Text> State: {props.state} </Card.Text></Row>
      <Row><Card.Text> Zipcode: {props.zipcode} </Card.Text></Row>
      <>
        <Button variant="primary" onClick={handleShow}>
          Launch demo modal
        </Button>

        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>Modal heading</Modal.Title>
          </Modal.Header>
          <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
              Close
            </Button>
            <Button variant="primary" onClick={handleClose}>
              Save Changes
            </Button>
          </Modal.Footer>
        </Modal>
      </>

      <Card.Link href="#">Another Link</Card.Link>
    </Card.Body>
  </Card>

 //    <Container className="profile">
 //      <Row>
 //        <Col>{props.email}</Col>
 //        <Col>{props.city}</Col>
 //        <Col>{props.state}</Col>
 //        <Col>{props.zipcode}</Col>
 //      </Row>
 // </Container>
);
}
}

export default Info;
